import React from "react";

export default function Nav(props){
    return (
        <div className="nav">
            <p>Olá essa é a nav</p>
            <ul>
                <li>Home</li>
                <li>Aulas</li>
                <li>Sobre</li>
            </ul>
        </div>
    )
}
